import CategoriesItem from './CategoriesItem';
import BackGround from '../UI/BackGround';
import Card from '../UI/Card';

function Categories() {
	return (
		<div>
			<BackGround />
			<Card className='content'>
				<CategoriesItem />
			</Card>
		</div>
	);
}

export default Categories;
